import axios from 'axios';

function CreateArticlesAcademie() {
    const formData = new FormData();
    formData.append("titleAcademie", this.titleAcademie);
    formData.append("contentAcademie", this.contentAcademie);
    axios.post('http://localhost:1337/api/articles-academies', formData);
}

export default CreateArticlesAcademie;
